== Compatibility ==
The only thing needed to use Messenger Plus! Live is Windows Live Messenger (the latest version of MSN Messenger) which requires Windows XP or above. Messenger Plus! Live can be installed on 32bit and 64bit versions of Windows XP and Windows Vista.
For a version of Messenger Plus! compatible with MSN/Windows Messenger 4.7 to 7.5 (Windows 98/2000 users), download Messenger Plus! 3.63.

